# Given a string s, you are allowed to convert it to a palindrome by adding characters in front of it. Find and return the shortest palindrome you can find by performing this transformation.

# Example 1:

# Input: "aacecaaa"
# Output: "aaacecaaa"
# Example 2:

# Input: "abcd"
# Output: "dcbabcd"
class Solution(object):
    def shortestPalindrome(self, s):
        """
        :type s: str
        :rtype: str
        """
        hash_str=self.prepareString(s)
        # Get the middle index
        # Expand on both sides
        # From the first mismatch, create resulting string
        mid=len(hash_str)/2
        max_matches=0
        print(mid)

        for mid_index in range(mid,-1,-1):
            temp_matches=0
            temp_mid=mid_index
            
            if(max_matches>mid_index):
                break;

            for index in range(mid_index,len(hash_str)):
                i=index+1
                j=mid_index-(index-mid_index)-1
                
                if(i>=len(hash_str) or j<0 or hash_str[i]!=hash_str[j]):
                    if(temp_matches>=max_matches):                        
                        max_matches=temp_matches
                        mid=temp_mid                        
                    break
                else:
                    temp_matches=temp_matches+1
                
        
        print("mid: "+str(mid))
        print("max matches: "+str(max_matches))

        if(mid-max_matches!=0):
            mid=0
            max_matches=0
            # Find max index to repeat
            while(True):
                if(hash_str[mid]==hash_str[len(hash_str)/2 + mid]):
                    #print(mid)
                    mid=mid+1

                else:
                    break       
        

        req_chars= hash_str[mid+max_matches+1:][::-1]
        
        return (req_chars+hash_str).replace("#","")

    def prepareString(self,s):
        hash_string='#'
        for index in range(len(s)):
            hash_string=hash_string+s[index]+'#'
        return hash_string
    

s=Solution();
print(s.shortestPalindrome(""))